// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title TimeLock
 * @notice A general-purpose timelock contract designed for scheduling and executing
 *         upgrades or arbitrary function calls after a set delay. Integrates with
 *         an Ownable constructor that requires an owner address.
 *
 *         Key Features:
 *         1) queueUpgrade(...) or queueCall(...) can schedule an operation.
 *         2) Once the `delay` has passed (but before `delay + gracePeriod`), 
 *            anyone can execute the operation, provided it's not canceled or executed.
 *         3) If the grace period expires, the operation cannot be executed (it’s expired).
 *         4) The contract uses an owner-based approach for controlling the scheduling, 
 *            canceling, and execution of timelocked operations.
 */
contract TimeLock is Ownable {
    /**
     * @dev Each scheduled operation is recorded here. 
     *      In this simplified code, we only show “upgrade” scheduling. 
     *      You could expand it to arbitrary calls if needed.
     */
    struct UpgradeRequest {
        address targetContract;      // The proxy contract to upgrade
        address newImplementation;   // The new logic contract
        uint256 earliestExecuteTime; // Earliest block timestamp to execute
        bool executed;
        bool canceled;
    }

    /**
     * @dev The minimum wait time between scheduling an operation and executing it.
     */
    uint256 public delay;

    /**
     * @dev After `earliestExecuteTime + gracePeriod` passes, the operation expires.
     */
    uint256 public gracePeriod;

    /**
     * @dev A mapping of requestId => UpgradeRequest data.
     */
    mapping(bytes32 => UpgradeRequest) public requests;

    /**
     * @dev Emitted when a new upgrade request is queued.
     */
    event UpgradeQueued(
        bytes32 indexed requestId,
        address target,
        address implementation,
        uint256 executeTime
    );

    /**
     * @dev Emitted when an upgrade request is canceled.
     */
    event UpgradeCanceled(bytes32 indexed requestId);

    /**
     * @dev Emitted when an upgrade request is successfully executed.
     */
    event UpgradeExecuted(bytes32 indexed requestId);

    /**
     * @notice Constructor that initializes the contract with an owner, 
     *         a required delay, and a grace period.
     * @param initialOwner   The owner of this timelock (e.g. a DAO or admin).
     * @param _delay         The mandatory wait time before execution.
     * @param _gracePeriod   The time window after _delay during which the operation remains valid.
     */
    constructor(address initialOwner, uint256 _delay, uint256 _gracePeriod) Ownable(initialOwner) {
        require(_gracePeriod > 0, "TimeLock: gracePeriod must be > 0");
        delay = _delay;
        gracePeriod = _gracePeriod;
    }

    /**
     * @dev Creates an ID for an upgrade request based on the target contract, newImplementation,
     *      and the current block timestamp (to differentiate repeated requests).
     */
    function getRequestId(address target, address newImplementation) public view returns (bytes32) {
        return keccak256(abi.encodePacked(target, newImplementation, block.timestamp));
    }

    /**
     * @notice Schedules an upgrade of a UUPS proxy (or any other upgradable) after `delay`.
     * @param targetContract    The proxy contract to upgrade.
     * @param newImplementation The new logic contract address.
     * @return requestId        The unique ID of the scheduled operation.
     */
    function queueUpgrade(address targetContract, address newImplementation) external onlyOwner returns (bytes32) {
        require(targetContract != address(0), "TimeLock: invalid target");
        require(newImplementation != address(0), "TimeLock: invalid implementation");

        bytes32 requestId = getRequestId(targetContract, newImplementation);
        UpgradeRequest storage req = requests[requestId];
        require(req.targetContract == address(0), "TimeLock: request already queued");

        req.targetContract = targetContract;
        req.newImplementation = newImplementation;
        req.earliestExecuteTime = block.timestamp + delay;
        req.executed = false;
        req.canceled = false;

        emit UpgradeQueued(requestId, targetContract, newImplementation, req.earliestExecuteTime);
        return requestId;
    }

    /**
     * @notice Cancels a previously queued upgrade request that has not been executed or canceled yet.
     * @param requestId The ID of the request to cancel.
     */
    function cancelUpgrade(bytes32 requestId) external onlyOwner {
        UpgradeRequest storage req = requests[requestId];
        require(req.targetContract != address(0), "TimeLock: unknown request");
        require(!req.executed, "TimeLock: request already executed");
        require(!req.canceled, "TimeLock: request already canceled");

        req.canceled = true;
        emit UpgradeCanceled(requestId);
    }

    /**
     * @notice Executes a queued upgrade if within the valid window [earliestExecuteTime, earliestExecuteTime+gracePeriod].
     * @param requestId The ID of the request.
     */
    function executeUpgrade(bytes32 requestId) external {
        UpgradeRequest storage req = requests[requestId];
        require(req.targetContract != address(0), "TimeLock: unknown request");
        require(!req.executed, "TimeLock: request already executed");
        require(!req.canceled, "TimeLock: request canceled");
        require(block.timestamp >= req.earliestExecuteTime, "TimeLock: too early");
        require(
            block.timestamp <= req.earliestExecuteTime + gracePeriod,
            "TimeLock: request expired"
        );

        // attempt to call upgradeTo(...) on the target contract
        (bool success, ) = req.targetContract.call(
            abi.encodeWithSignature("upgradeTo(address)", req.newImplementation)
        );
        require(success, "TimeLock: upgrade call failed");

        req.executed = true;
        emit UpgradeExecuted(requestId);
    }

    /**
     * @notice The owner can adjust the `delay` for future requests. Does not affect existing ones.
     * @param newDelay The new mandatory wait time in seconds.
     */
    function setDelay(uint256 newDelay) external onlyOwner {
        delay = newDelay;
    }

    /**
     * @notice The owner can adjust the `gracePeriod` for future requests. Does not affect existing ones.
     * @param newGrace The new grace period in seconds.
     */
    function setGracePeriod(uint256 newGrace) external onlyOwner {
        require(newGrace > 0, "TimeLock: invalid grace");
        gracePeriod = newGrace;
    }
}

